import React from "react";
import "./Header.css";
import SearchIcon from "@material-ui/icons/Search";

function Header() {
  return (
    <div className="header">
      <img
        className="header_logo"
        src="data:image/png;base64,"
      />

      <div className="header_search">
        <input className="header_searchInput" type="text" />{" "}
        <searchicon className="header_searchIcon" />
      </div>

      <div className="header_nav">
        <div className="header_option">
          <span className="header_option_LineOne">Hola, Huesped </span>
          <span className="header_option_LineTwo"> Sign In/Up</span>
        </div>

        <div className="header_option">
          <span className="header_option_LineOne">Orders </span>
          <span className="header_option_LineTwo"> / Returns</span>
        </div>

        <div className="header_option">
          <span className="header_option_LineOne">Your </span>
          <span className="header_option_LineTwo"> Prime</span>
        </div>
      </div>
    </div>
  );
}

export default Header;
